import React from 'react'
import { Card } from '../Components/Card'

export const MoviePage = () => {
  return (

    <>

        {props.todos.map((todo)=>{
                return (
                  <TodoItem todo={todo} key={todo.sno} onDelete={props.onDelete}/>
                )
              })}
        <Card/>
    </>
  )
}
